    return (  
        <div className = 'security-services'>
            <h1>Director Security Services</h1>


            <Iframe src="!1m18!1m12!1m3!1d4710.472774843814!2d3.719752202637028!3d6.888246964499265!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x103bd83e6b0c565f%3A0x2fa8dcb8739701b5!2sBabcock%20university%20Registry!5e0!3m2!1sen!2sng!4v1606595308471!5m2!1sen!2sng" width="80%" height="460" allowfullscreen="" aria-hidden="false" tabindex="0"></Iframe>

